import './App.css';
import { Routes, Router } from 'react-router'
import { Navigation } from './components/Navigation/index'
import { Homepage } from './components/Navigation/index'
import { Resume } from './components/Resume/index'
import { Portfolio } from './components/Portfolio/index'
import { Contact } from './components/Contact/index'

function App() {
  return (
    <>
      <Navigation />
      <Routes>
        <Router exact path="/" element={<Homepage />}>
        <Router path="resume" element={<Resume />} />
        <Router path="portfolio" element={<Portfolio />} />
        <Router path="contact" element={<Contact />} />
        </Router>
      </Routes>
    </>
  );
}

export default App;
